import React from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Form from 'react-bootstrap/Form'
import classNames from 'classnames';
import Button from 'react-bootstrap/Button'
import FormControl from 'react-bootstrap/FormControl'
import NavDropdown from 'react-bootstrap/NavDropdown'
import PropTypes from 'prop-types';
import { elementType } from 'prop-types-extra';
import uncontrollable from 'uncontrollable';

import createWithBsPrefix from './utils/createWithBsPrefix';
import NavbarCollapse from './NavbarCollapse';
import NavbarToggle from './NavbarToggle';
import { createBootstrapComponent } from './ThemeProvider';
import NavbarContext from './NavbarContext';
import SelectableContext from './SelectableContext';
class NavigationBar extends React.PureComponent{
  render(){
    const{ params } = this.props;
    return(
      <Navbar  className = "bg2" variant = "dark">
        <Navbar.Brand href="#home" float= "left"><img src="http://razzlers.me:8080/Razzlers_files/Razzlers-Logo.png" height = "60"/></Navbar.Brand>
          <Nav class="d-inline-flex p-3 bg-secondary text-white">
            <button className = 'redirects'>NetFlix</button>
            <Nav.Link href="About" class="d-flex flex-wrap">About</Nav.Link>
          </Nav>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button className="button2">Search</Button>
      </Navbar>
  );
  }
}
export default NavigationBar;
